    func drawCanvas3(frame frame: CGRect = CGRect(x: 0, y: 0, width: 240, height: 120), labelText: String = "No workouts found. Add workouts through the Health app or through the New button above.") {
        //// Color Declarations
        let color2 = UIColor(red: 0.937, green: 0.937, blue: 0.957, alpha: 1.000)
        
        //// Rectangle Drawing
        let rectanglePath = UIBezierPath(rect: CGRect(x: frame.minX, y: frame.minY, width: frame.width, height: floor((frame.height) * 1.00000 + 0.5)))
        color2.setFill()
        rectanglePath.fill()
        
        
        //// Text Drawing
        let textRect = CGRect(x: frame.minX + floor((frame.width - 220) * 0.50000 + 0.5), y: frame.minY + 10, width: 220, height: 96)
        let textStyle = NSMutableParagraphStyle()
        textStyle.alignment = .Center
        
        let textFontAttributes = [NSFontAttributeName: UIFont(name: "Dosis-Regular", size: 17)!, NSForegroundColorAttributeName: UIColor.blackColor(), NSParagraphStyleAttributeName: textStyle]
        
        NSString(string: labelText).drawInRect(textRect, withAttributes: textFontAttributes)
    }




